A slot schedule is simply a list of slots that you want to encrypt a message for. For example, a slot schedule could be [290871100, 290871105, 290871120]. In general, we can think of the slot schedule as being the ids input field to the encrypt function in the EtfApi. Along with the AES secret key produced by the DefaultApiClient, knowledge of the slot schedule along with the capsule (output from encryption) is enough information to recover the master key. The SDK provides the SlotScheduler interface that can be implemented to create your own slot scheduling logic. export interface SlotScheduler<T> { generateSchedule(n: number, currentSlot: number, input: T): SlotSchedule;
} By default, the SDK includes an implementation: the DistanceBasedSlotScheduler: const slotScheduler = new DistanceBasedSlotScheduler()
let slotSchedule = slotScheduler.generateSchedule({ slotAmount: shares, currentSlot: parseInt(latestSlot.slot.replaceAll(",", "")), distance: distance, })

